import axios from "axios";
import React, { useEffect } from "react";

interface IProps {
  id: number;
}

const QuizTest: React.FC<IProps> = ({ id }) => {
  useEffect(() => {
    axios({
      method: "GET",
    });
  }, []);

  return <p>{id}</p>;
};

export default QuizTest;
